const SaveClasHts = async (event1, event2, idcliente) => {
	const myHeaders = new Headers();
	myHeaders.append('Content-Type', 'application/json');
    console.log("PICPIICIO", idcliente)
	const fecha = new Date();
	const fecha1 = fecha.toDateString();
	const raw = JSON.stringify({
		idcliente: idcliente,
		htsdetails: event1,
		fecha: fecha1,
		sku: event2
	});

	const requestOptions = {
		method: 'POST',
		headers: myHeaders,
		body: raw
	};

	fetch('https://oyq0mrdzsf.execute-api.us-east-1.amazonaws.com/dev/saveclashts', requestOptions)
		.then(response => response.json())
		.then(result => console.log(result))
		.catch(error => console.log('error', error));

	return '';
};

export default SaveClasHts;
